import web3 from './web3';
import Verify from './build/Verify.json';

const instance = new web3.eth.Contract(
    //JSON.parse(Verify.interface),
    Verify.abi,
    '0xc8B13d03be7B417E1E25194ED2e8983cE263CD49'
);

export default instance;
